import React from 'react'
import {AppBar,Toolbar} from '@material-ui/core';
import Logo from '../images/logoBreakingBad';
 const Navbar =()=>{
    return (
        <AppBar position='static'>
            <Toolbar>
                <img src={Logo} alt="logo"></img>
            </Toolbar>
        </AppBar>
    );
}
export default Navbar;
